import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
class BtnSearch extends React.Component {
    render() {
        return (
            <>
            <button ><FontAwesomeIcon icon="search"/> </button>  
            </>
        );
    }
}
export default BtnSearch;
